import React,{useState} from 'react';
//import { Navbar, Nav, Form, FormControl, Button } from 'reactstrap';

import { Container, Row, Col } from 'reactstrap';

const Tabbar = (props) => {




  return (
    <div>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="/">Your Table Is Here</NavbarBrand>


          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink href="https://github.com/reactstrap/reactstrap">예약하기</NavLink>
            </NavItem>
            <UncontrolledDropdown nav inNavbar>

              <DropdownMenu right>
                <DropdownItem>
                  Option 1
                </DropdownItem>
                <DropdownItem>
                  Option 2
                </DropdownItem>
                <DropdownItem divider />
                <DropdownItem>
                  Reset
                </DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>
          </Nav>

      </Navbar>
    </div>
  );
}

export default Tabbar;
